  <main class="mt-5">
    <div class="container">
      <hr class="my-5" />

      <!--Section: Content-->
      <section class="mb-5">
        <h4 class="mb-5 text-center"><strong>Please input your information</strong></h4>

        <div class="row d-flex justify-content-center">
          <div class="col-md-6">
            <form method="POST">
            {{form.hidden_tag()}}
              <div class="row mb-2">
                <div class="col">
                  <div class="form-outline">
                    {{form.first_name.label}}
                    {{form.first_name()}}
                  </div>
                </div>
                <div class="col">
                  <div class="form-outline">
                    {{form.last_name.label}}
                    {{form.last_name()}}
                  </div>
                </div>
                <div class="col">
                  <div class="form-outline">
                     {{form.email.label}}
                      {{form.email()}}
                  </div>
                </div>
              </div>

              <!-- Checkbox -->
              <div class="form-check d-flex justify-content-center mb-4">
                <input class="form-check-input me-2" type="checkbox" value="" id="form2Example3" checked />
                <label class="form-check-label" for="form2Example3">
                  Subscribe to our newsletter
                </label>
              </div>

              <!-- Submit button -->
              <div class="d-flex justify-content-center">
                {{form.submit()}}
              </div>

            </form>
          </div>
        </div>
      </section>
      <!--Section: Content-->
    </div>
